import React from 'react'
import {AppBar, Toolbar, Typography} from "@material-ui/core"
const Appbar = () => {
    return (
        <AppBar >
            <Toolbar>
                <Typography>my header</Typography>
            </Toolbar>
        </AppBar>
    )
}

export default Appbar
